import logo from "./../signature.svg";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="Home">
      <img src={logo} className="Home-logo" alt="logo" />
      <header className="Home-header">
        <p className="Home-description">
          Software Engineer
        </p>
        <Link
          className="Home-link"
          to="/work"
        >
          Work
        </Link>
      </header>
    </div>
  )
}
